import { Component, OnInit } from '@angular/core';
import { Militar } from '../militar';

@Component({
  selector: 'app-militar-list',
  templateUrl: './militar-list.component.html',
  styleUrls: ['./militar-list.component.css']
})
export class MilitarListComponent implements OnInit {

 militars: Militar[] = [];

  constructor(private mil) { }


  ngOnInit(): void {
    this.militars = [{
      "id": 1,
      "nome": "Jefferson",
      "sobrenome": "Domingos",
      "tiposanguineo": "A",
      "patente": "Soldado"
    }];


   }



}
